package com.example.auta.domain.entities;import com.example.auta.models.classes.Branch;import com.example.auta.models.classes.Car;import com.example.auta.models.classes.Customer;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import java.math.BigDecimal;import java.time.LocalDate;import java.util.UUID;@Entity@Data@NoArgsConstructor@Builder@AllArgsConstructorpublic class ReservationEntity {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "org.hibernate.id.UUID")    private UUID id;    private LocalDate raservationDate;    @ManyToOne    private CustomerEntity customer;    @OneToOne    private CarEntity car;    private LocalDate rentalStartDate;    private LocalDate rentalEndDate;    @ManyToOne    private BranchEntity rentalBranch;    @ManyToOne    private BranchEntity returnBranch;    private BigDecimal totalPrice;}